import {
    dbs_4,
    racks_4,
    dbRackConnections as dbRackConnections_4
} from "../components/Layout/floor4_layout";
import {
    dbs as dbs_15,
    racks as racks_15,
    workdesks as workdesks_15,
    dbRackConnections as dbRackConnections_15
} from "../components/Layout/floor15_layout";


export const floorData = {
    4: {
        dbs: dbs_4,
        racks: racks_4,
        connections: dbRackConnections_4,
        tables: []
    },
    15: {
        dbs: dbs_15,    
        racks: racks_15,
        connections: dbRackConnections_15,
        tables: workdesks_15
    }
};
